import React from "react";
import "./UserInfoPage.css"; // reuse same CSS file for consistent look

export default function Profile() {
  return (
    <div className="user-page">
      {/* Header */}
      <div className="user-header">
        <h1>My Profile</h1>
        <p>Manage your LiftOff account and preferences</p>
      </div>

      {/* Profile Card */}
      <div className="user-content">
        <div className="profile-card">
          <p><strong className="highlight">Name:</strong> Saba Irfan</p>
          <p><strong className="highlight">Email:</strong> saba.irfan@example.com</p>
          <p><strong className="highlight">Frequent Flyer #:</strong> LIFT12345</p>
          <p><strong className="highlight">Upcoming Flight:</strong> JFK â†’ LHR on Nov 20, 2025</p>
        </div>
      </div>
    </div>
  );
}
